Vancouver, we're excited to announce that we're hosting a Holiday Market with local Empowerful Incubator members!! Join us, Free Label and 6 BIPOC small businesses this Saturday 💓
⠀⠀⠀⠀⠀⠀⠀⠀⠀
98% of businesses in British Columbia are small businesses and this holiday season is the perfect opportunity to discover new favourites. With this market, we're here to make your shopping experience a breeze! Imagine checking out multiple awesome brands in one spot, minus the mall madness. And you'll feel good in supporting small independent businesses!
⠀⠀⠀⠀⠀⠀⠀⠀⠀
When: Saturday, December 9 (10 am - 4 pm)
Where: 1355 Parker Street
⠀⠀⠀⠀⠀⠀⠀⠀⠀
✅ Shop IRL! Save on shipping and go home with your FL purchase
✅ Try on and get in-person fit guidance 
